"    <div id=\"topicTitle\">",
"     Patient information: Kyphosis in adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/kyphosis-in-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H113224871\">",
"      <span class=\"h1\">",
"       What is kyphosis in adults?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Kyphosis is the term doctors use to describe a curving of the upper back. A normal backbone (spine) has a slight curve. In a person with kyphosis, the upper part of the spine curves more than normal, causing a rounded or hunched back (",
"      <a class=\"graphic graphic_figure graphicRef83274 \" href=\"UTD.htm?31/19/32048\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Kyphosis is also called &ldquo;hyperkyphosis&rdquo; or &ldquo;dowager&rsquo;s hump.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H113224886\">",
"      <span class=\"h1\">",
"       What causes kyphosis in adults?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Kyphosis in adults happens because of problems with different parts of the spine (see Kyphosis PI). These include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Vertebrae &ndash; These are the bones of the spine that sit on top of one another like a stack of coins.",
"       </li>",
"       <li>",
"        Discs &ndash; These are the rubbery cushions between each of the vertebrae.",
"       </li>",
"       <li>",
"        Muscle, tendons, and ligaments &ndash; Together, these are known as the &ldquo;soft tissues&rdquo; of the back. These tissues support the back and help hold it together.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      The problems that can cause kyphosis include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Osteoporosis &ndash; This disease causes weak bones that break too easily. Tiny cracks or breaks in the vertebrae (called &ldquo;vertebral fractures&rdquo;) can cause the vertebrae to collapse or shrink.",
"       </li>",
"       <li>",
"        Degenerative disc disease &ndash; This happens when the spinal discs start to shrink and break down.",
"       </li>",
"       <li>",
"        Weak muscles in the lower back &ndash; Weak back muscles can make it hard to stand up straight. This can cause slouching.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H113224903\">",
"      <span class=\"h1\">",
"       What are the symptoms of kyphosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main symptom is a hunched or rounded back that might hurt or feel stiff. People with kyphosis might also notice that their belly has gotten bigger even though they have not gained weight. Other possible symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Neck or hip pain",
"       </li>",
"       <li>",
"        Trouble breathing",
"       </li>",
"       <li>",
"        Trouble swallowing",
"       </li>",
"       <li>",
"        Having acid that is normally in your stomach back up into your throat (a condition called &ldquo;acid reflux&rdquo;)",
"       </li>",
"       <li>",
"        Having a hard time doing everyday things, like walking, getting up from a chair, dressing, and bathing",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H113224918\">",
"      <span class=\"h1\">",
"       Is there a test for kyphosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse should be able to tell if you have it by doing an exam. But you will likely get a back X-ray and other tests to measure the curve of your back.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H113224933\">",
"      <span class=\"h1\">",
"       How is kyphosis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The treatment depends on what caused the problem and how serious it is. Treatments can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines for osteoporosis",
"       </li>",
"       <li>",
"        Exercises to stretch and strengthen the back",
"       </li>",
"       <li>",
"        Medicines to ease pain",
"       </li>",
"       <li>",
"        Surgery &ndash; Doctors do surgery only if a person has trouble breathing or has very bad pain that does not get better with medicines or other treatments.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H113224948\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?34/58/35746?source=see_link\">",
"       Patient information: Osteoporosis (The Basics)",
"      </a>",
"     </p>",
