var title_f28_62_29669="Normal impulse conduction";
var content_f28_62_29669=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F57781%7ECARD%2F58689&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F57781%7ECARD%2F58689&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 570px\">",
"   <div class=\"ttl\">",
"    Schema of normal impulse conduction in the heart",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 550px; height: 332px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The sinoatrial node (SAN) generates an action potential that is conducted through the right and left atria, resulting in atrial contraction. The impulse is then conducted through the atrioventricular node (AVN), activating the ventricular myocardium, resulting in contraction of the right and left ventricle.",
"    <div class=\"footnotes\">",
"     SVC: superior vena cava; IVC: inferior vena cava; PV: pulmonary veins; LAA: left atrial appendage; RAA: right atrial appendage.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electrical activity in atrial fibrillation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 357px; height: 280px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    During atrial fibrillation there are multiple reentrant circuits within the right and left atrium, resulting in nonuniform activitation of the atrial myocardium. These circuits, which produce multiple wavelets, often occur around the normal structures of the atrial including the orifices of the superior (SVC) and inferior (IVC) vena cavae, the orifice of the pulmonary veins (PVs), and the right (RAA) and left (LAA) atrial appendages.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
