var title_f28_62_29675="Indications and timing of the infertility evaluation";
var content_f28_62_29675=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F70415&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F70415&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Indications and timing of the infertility evaluation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Infertility evaluation is indicated for couples who seek help because they have not been able to conceive.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       1. Initiate evaluation after 12 months of unprotected and frequent intercourse:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       Women under age 35 years without risk factors for infertility.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       2. Initiate evaluation after six months of unprotected and frequent intercourse:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       Women age 35 to 40 years.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       3. Initiate evaluation upon presentation despite less than six months of unprotected and frequent intercourse:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       Women over 40 years of age.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       Women with oligomenorrhea/amenorrhea.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       Women with a history of chemotherapy, radiation therapy, or advanced stage endometriosis.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       Women with known or suspected uterine/tubal disease.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       Women whose male partner has a history of groin or testicular surgery, adult mumps, impotence or other sexual dysfunction, chemotherapy and/or radiation, or a history of subfertility with another partner.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
