var title_f28_62_29676="Glasgow coma scale";
var content_f28_62_29676=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F81854&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F81854&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Glasgow coma scale",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"90%\">",
"     </colgroup>",
"     <colgroup width=\"10%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Score",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Eye opening",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Spontaneous",
"       </td>",
"       <td class=\"centered\">",
"        4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Response to verbal command",
"       </td>",
"       <td class=\"centered\">",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Response to pain",
"       </td>",
"       <td class=\"centered\">",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        No eye opening",
"       </td>",
"       <td class=\"centered\">",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Best verbal response",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Oriented",
"       </td>",
"       <td class=\"centered\">",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Confused",
"       </td>",
"       <td class=\"centered\">",
"        4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Inappropriate words",
"       </td>",
"       <td class=\"centered\">",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Incomprehensible sounds",
"       </td>",
"       <td class=\"centered\">",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        No verbal response",
"       </td>",
"       <td class=\"centered\">",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Best motor response",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Obeys commands",
"       </td>",
"       <td class=\"centered\">",
"        6",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Localizing response to pain",
"       </td>",
"       <td class=\"centered\">",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Withdrawal response to pain",
"       </td>",
"       <td class=\"centered\">",
"        4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Flexion to pain",
"       </td>",
"       <td class=\"centered\">",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Extension to pain",
"       </td>",
"       <td class=\"centered\">",
"        2",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\">",
"        No motor response",
"       </td>",
"       <td class=\"centered\">",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Total",
"        </strong>",
"       </td>",
"       <td class=\"centered\">",
"        <strong>",
"         &nbsp;",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The GCS is scored between 3 and 15, 3 being the worst, and 15 the best. It is composed of three parameters: best eye response (E), best verbal response (V), and best motor response (M). The components of the GCS should be recorded individually; for example, E2V3M4 results in a GCS score of 9. A score of 13 or higher correlates with mild brain injury; a score of 9 to 12 correlates with moderate injury; and a score of 8 or less represents severe brain injury.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
