var title_f28_62_29677="ACE inhibitors improve outcome after MI";
var content_f28_62_29677=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F58405&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F58405&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    ACE inhibitors improve outcome after a myocardial infarction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 369px; height: 247px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A meta-analysis of 5966 patients with left ventricular dysfunction after a myocardial infarction enrolled in the SAVE, AIRE, and TRACE trials shows that after a median follow-up of 31 months there is a significant reduction in mortality with an angiotensin converting enzyme (ACE) inhibitor (23.4 versus 29 percent, odds ratio 0.74, p &lt;0.0001). There is a continuing divergence in the mortality curves during follow-up that exceeds four years.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Flather MD, Yusuf S, Kober L, et al. Lancet 2000; 355:1575.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
