" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Small bowel ischemia on plain abdominal film",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 281px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A plain radiograph of the abdomen demonstrates distended featureless loops of small bowel with wall thickening (arrow) and separation of the bowel loops. These findings are consistent with hemorrhage into the bowel wall secondary to ischemia.",
"    <div class=\"footnotes\">",
"    </div>",
